Always know where your child is with MyKi™ GSM-GPS watch and the MyKi Watch app, sold separately. The app works together with MyKi™ GSM-GPS watch.

Features on the MyKi Watch app include:
Tracking function: You can check the present location of your child wearing a MyKi™ GSM-GPS watch, at any time and browse the location history for the past month.

Footprints function: You can set two Safe Zones, in which you know your child is secure. Also, you can add a speed limit. Thus, you will be notified if your child leaves the Safe Zone and/or is moving too fast.

Communication functions: You can call the watch or send voice and text messages to your child via the app. The child may reply with a voice message or a telephone call from the MyKi™ GSM-GPS watch.

Health function: This function counts the steps of your child and, based on standard measures, brings back full information for the number of steps, passed meters, and burned calories during the day.

Alarm function: You can set up to 3 alarms.

Other functions:
• Whitelist of phone numbers calling the watch;
• Phonebook of phone numbers to be dialed by the watch;
• SOS and Family numbers;
• Push Notifications;
• SMS & Email Alerts;
• Rewards;
• Removed from hand notification;
• Sleeping time Mode;
• Low Power Mode;
• Do Not Disturb Mode;

Encrypted data.
Cloud support.
